<html lang="zh-TW">

	<link id="favicon" rel="icon" href="" />
    <meta charset="UTF-8">

    <title>Dev html V25</title>
    <script src="https://cdn.jsdelivr.net/npm/crypto-js@4.2.0/crypto-js.min.js"></script>
    <style>
        :root { --bg: #0f172a; --card: #1e293b; --text: #f8fafc; }
        body, html { margin:0; padding:0; width:100%; height:100%; background:var(--bg); font-family:-apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, sans-serif; overflow:hidden; display:flex; justify-content:center; align-items:center; color: var(--text); }
        #auth-container { position: relative; width: 90%; max-width: 350px; background: rgba(30, 41, 59, 0.8); backdrop-filter: blur(10px); -webkit-backdrop-filter: blur(10px); padding: 40px 30px; border-radius: 20px; box-shadow: 0 20px 50px rgba(0,0,0,0.5); border: 1px solid rgba(255,255,255,0.1); text-align: center; transition: all 0.5s ease; }
        h2 { margin: 0 0 5px; font-weight: 700; letter-spacing: 1px; }
        p.hint { margin: 0 0 25px; font-size: 13px; color: #94a3b8; }
        .input-box { position: relative; margin-bottom: 20px; }
        input { width: 100%; padding: 15px; border-radius: 12px; border: 2px solid #334155; background: #000; color: #fff; font-size: 16px; text-align: center; box-sizing: border-box; transition: 0.3s; font-family: monospace; letter-spacing: 2px; }
        input:focus { border-color: #fff; outline: none; box-shadow: 0 0 0 4px rgba(255,255,255,0.1); }
        button { width: 100%; padding: 15px; border: 1px solid rgba(255,255,255,0.2); border-radius: 12px; background: #000; color: white; font-size: 16px; font-weight: 600; cursor: pointer; transition: 0.3s; letter-spacing: 0.5px; }
        button:hover { background: #222; transform: translateY(-2px); border-color: #fff;}
        button:active { transform: translateY(0); }
        #msg { height: 20px; margin-top: 15px; font-size: 13px; color: #f87171; opacity: 0; transition: opacity 0.3s; }
        iframe { position:fixed; top:0; left:0; width:100%; height:100%; border:none; z-index:10; background:#fff; display:none; opacity:0; transition: opacity 0.5s; }
        .shake { animation: shake 0.4s cubic-bezier(.36,.07,.19,.97) both; }
        @keyframes shake { 10%, 90% { transform: translate3d(-1px, 0, 0); } 20%, 80% { transform: translate3d(2px, 0, 0); } 30%, 50%, 70% { transform: translate3d(-4px, 0, 0); } 40%, 60% { transform: translate3d(4px, 0, 0); } }
        .unlocking { transform: scale(1.1); opacity: 0; filter: blur(10px); }
    </style>
</head>

            if (!password) { showError(); return; }
